import './App.css';
import Nav from './components/Nav';
import Form from './components/Form';
import Entry from './components/Entry';
import Small from './components/Small';

function App() {
  return (
    <div className="App">
       <Nav/>

       <Form/>

         <div class = "entry">

          <div>1:</div>
          <div class = "spbox">Presbo</div>
          <div>presbo@columbia.edu</div>
          <button class = "press delete">Delete</button>

        </div>


        <div class = "entry">

          <div>2:</div>
          <div>John Jay Mouse</div>
          <div>mouse@columbia.edu</div>
          <button class = "press delete">Delete</button>

        </div>

        <div class = "entry">

          <div>3:</div>
          <div>Water Bottle Man</div>
          <div>flipper@columbia.com</div>
          <button class = "press delete">Delete</button>

        </div>

      <Entry num = "1:" name = "Presbo" email = 'presbo@columbia.edu'/>
      <Entry num = "2:" name = "John Jay Mouse" email = 'mouse@columbia.edu'/>
      <Entry num = "3:" name = "Water Bottle Man" email = 'flipper@columbia.com'/>

      <Small small = "yes"/>


    </div>
  );
}

export default App;
